import React, { useState } from 'react';

function App() {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState(null);

  const exampleQueries = [
    'Show me all diabetic patients over 50',
    'Find female patients with hypertension',
    'List patients under 30 with depression',
    'Show male patients with heart disease over 65',
    'Get all active asthma patients',
  ];

  const handleSubmit = async (e) => {
  e.preventDefault();
  try {
    const res = await fetch('http://localhost:5000/api/query', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ query }),
    });

    if (!res.ok) throw new Error("Backend error");
    const data = await res.json();
    setResults(data);
  } catch (err) {
    console.error("Failed to fetch data:", err);
    alert("Something went wrong. Check your backend is running.");
  }
  };


  return (
    <div style={{ fontFamily: 'sans-serif', padding: '2rem', maxWidth: '1000px', margin: 'auto' }}>
      <h1>ðŸ§  AI-Powered FHIR Query Interface</h1>
      <p>Ask questions about patient data in natural language.</p>

      <form onSubmit={handleSubmit} style={{ display: 'flex', marginBottom: '1rem' }}>
        <input
          type="text"
          value={query}
          onChange={(e) => setQuery(e.target.value)}
          placeholder="Show me all diabetic patients over 50"
          style={{ flex: 1, padding: '0.75rem', fontSize: '1rem' }}
        />
        <button type="submit" style={{ marginLeft: '1rem', padding: '0.75rem' }}>Search</button>
      </form>

      <div style={{ marginBottom: '1rem' }}>
        <strong>Try these examples:</strong>
        <div style={{ display: 'flex', flexWrap: 'wrap', gap: '0.5rem', marginTop: '0.5rem' }}>
          {exampleQueries.map((q, i) => (
            <button key={i} onClick={() => setQuery(q)} style={{ padding: '0.5rem 1rem', border: '1px solid #ccc' }}>
              {q}
            </button>
          ))}
        </div>
      </div>

      {results && (
        <div style={{ marginTop: '2rem' }}>
          <h2>Query Analysis</h2>
          <p><strong>Original Query:</strong> {results.original}</p>
          <p><strong>Extracted Intent:</strong> {results.intent}</p>

          <h3>ðŸŽ¯ Gender Distribution</h3>
          <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
            {['Male', 'Female'].map((gender) => (
              <div key={gender} style={{ flex: 1 }}>
                <div style={{ marginBottom: '0.25rem' }}>{gender}</div>
                <div style={{ background: '#eee', height: '10px', position: 'relative' }}>
                  <div style={{
                    width: `${results.genderCounts[gender] * 10}px`,
                    background: gender === 'Male' ? '#007bff' : '#e83e8c',
                    height: '10px',
                    position: 'absolute'
                  }}></div>
                </div>
              </div>
            ))}
          </div>

          <h3 style={{ marginTop: '2rem' }}>ðŸ“Š Age Distribution</h3>
          <ul style={{ listStyle: 'none', padding: 0 }}>
            {results.ageDistribution.map((row, i) => (
              <li key={i} style={{ marginBottom: '0.5rem' }}>
                <strong>{row.group}</strong>
                <div style={{ background: '#eee', height: '10px', position: 'relative' }}>
                  <div style={{
                    width: `${row.count * 20}px`,
                    background: '#17a2b8',
                    height: '10px',
                    position: 'absolute'
                  }}></div>
                </div>
              </li>
            ))}
          </ul>

          <h3 style={{ marginTop: '2rem' }}>ðŸ“‹ Patient Results ({results.patients.length} found)</h3>
          <table style={{ width: '100%', borderCollapse: 'collapse', marginTop: '1rem' }}>
            <thead>
              <tr style={{ background: '#f0f0f0' }}>
                <th style={{ padding: '0.5rem', textAlign: 'left' }}>Name</th>
                <th style={{ padding: '0.5rem', textAlign: 'left' }}>Age</th>
                <th style={{ padding: '0.5rem', textAlign: 'left' }}>Gender</th>
                <th style={{ padding: '0.5rem', textAlign: 'left' }}>Condition</th>
                <th style={{ padding: '0.5rem', textAlign: 'left' }}>Last Visit</th>
              </tr>
            </thead>
            <tbody>
              {results.patients.map((p, i) => (
                <tr key={i}>
                  <td style={{ padding: '0.5rem' }}>{p.name}</td>
                  <td style={{ padding: '0.5rem' }}>{p.age}</td>
                  <td style={{ padding: '0.5rem' }}>{p.gender}</td>
                  <td style={{ padding: '0.5rem' }}>{p.condition}</td>
                  <td style={{ padding: '0.5rem' }}>{p.lastVisit}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}

export default App;
